import React from 'react';
import List from './List';

class SaveCat extends React.Component {
  state = {
    list: []
  }
    componentDidMount() {
        this.saveCat();
    }

    saveCat = () => {
        fetch('/newestCampground')
        .then(res => res.json())
        .then(list => console.log(list));
    }
  render() {
    const { list } = this.state;
    list.splice(0, 1);
    return(
        <div className="App">
            <h1>List of Items</h1>
                {list.length ? (
                    <div>
                        {list.map(item => {
                            return(
                                <div>
                                    {item.name}
                                </div>
                            );
                        })}
                    </div>
                ) : (
                    <div>
                        <h2>No List items found</h2>
                    </div>
                )
            }
        </div>
    );
  }
}
export default SaveCat
